/*ReinforcedManagementReport = Lista de Informe Reforzado*/
import React, { useState } from "react"
import PropTypes from 'prop-types';

import {
  Row,
  Col,
  Card,
  CardBody,
  Button,
  Label,
} from "reactstrap"

import { AvForm, AvField, AvGroup } from "availity-reactstrap-validation"
import Switch from "react-switch";

//i18n
import { withTranslation } from "react-i18next"
import { BackendServices, CoreServices, BpmServices, } from "../../../../../services";
import { useLocation, useHistory } from 'react-router-dom'
import Select from "react-select";
import { useTranslation } from "react-i18next"

const Offsymbol = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100%",
        fontSize: 12,
        color: "#fff",
        paddingRight: 2,
      }}
    >
      {" "}
      No
    </div>
  );
};
const OnSymbol = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100%",
        fontSize: 12,
        color: "#fff",
        paddingRight: 2,
      }}
    >
      {" "}
      Si
    </div>
  );
};

const S_seccions = {
  "backgroundColor": "#eee",
  "color": '#187055',
  "padding": '2px',
  "borderRadius": '2px',
  "fontSize": '18px',
  "display": 'flex',
  "justifyContent": 'center',
};

const DatosGenerales = (props) => {

  const apiServiceBackend = new BackendServices();
  const apiServiceCore = new CoreServices();
